import { useEffect, useState } from 'react';
import { getDiscoverProfiles, likeProfile, passProfile, isOnline } from '../lib/supabase';
import { useAuth } from '../lib/AuthContext';
import { styles } from './styles';

export default function Dashboard() {
  const { profile } = useAuth();
  const [cards, setCards] = useState([]);
  const [current, setCurrent] = useState(0);
  const [action, setAction] = useState(null);
  const [loading, setLoading] = useState(true);
  const [matchNotif, setMatchNotif] = useState(false);

  useEffect(() => {
    if (profile) loadProfiles();
  }, [profile]);

  async function loadProfiles() {
    setLoading(true);
    try {
      const profiles = await getDiscoverProfiles(profile);
      setCards(profiles);
    } catch (e) {
      console.error(e);
    } finally {
      setLoading(false);
    }
  }

  async function handleLike() {
    const card = cards[current];
    if (!card) return;
    setAction('liked');
    try {
      const result = await likeProfile(profile.id, card.id);
      if (result.matched) {
        setMatchNotif(true);
        setTimeout(() => setMatchNotif(false), 3000);
      }
    } catch (e) {
      console.error(e);
    }
    setTimeout(() => { setCurrent(c => c + 1); setAction(null); }, 700);
  }

  async function handlePass() {
    const card = cards[current];
    if (!card) return;
    setAction('passed');
    try {
      await passProfile(profile.id, card.id);
    } catch (e) {
      console.error(e);
    }
    setTimeout(() => { setCurrent(c => c + 1); setAction(null); }, 700);
  }

  if (loading) return <div style={styles.loadingWrap}>Loading profiles...</div>;

  const card = cards[current];

  return (
    <div style={styles.page}>
      <h2 style={styles.pageTitle}>Discover</h2>
      <p style={styles.pageSubtitle}>All profiles are anonymous. No names, just vibes.</p>

      {matchNotif && (
        <div style={styles.matchBanner}>ðŸŽ‰ It's a match! Check your Matches tab.</div>
      )}

      {card ? (
        <div style={styles.discoverWrap}>
          <div style={{
            ...styles.profileCard,
            ...(action === 'liked' ? styles.cardLiked : {}),
            ...(action === 'passed' ? styles.cardPassed : {}),
          }}>
            <div style={styles.profileAvatar}>{card.alias?.[0] || '?'}</div>
            <div style={styles.profileAlias}>{card.alias}</div>
            <div style={styles.profileMeta}>
              Age {card.age} Â· {isOnline(card.last_seen) ? 'ðŸŸ¢ Online' : 'âš« Offline'}
            </div>
            {card.bio && <p style={styles.profileBio}>"{card.bio}"</p>}
            <div style={styles.interestRow}>
              {(card.interests || []).map(i => <span key={i} style={styles.interestTag}>{i}</span>)}
            </div>
            <div style={styles.actionRow}>
              <button style={styles.passBtn} onClick={handlePass} disabled={!!action}>âœ• Pass</button>
              <button style={styles.likeBtn} onClick={handleLike} disabled={!!action}>â™¥ Like</button>
            </div>
          </div>
          <div style={styles.cardCounter}>{current + 1} / {cards.length} profiles</div>
        </div>
      ) : (
        <div style={styles.emptyState}>
          <div style={{fontSize:64}}>ðŸŽ‰</div>
          <h3>You've seen everyone for now!</h3>
          <p>Check back later for new profiles.</p>
          <button style={{...styles.primaryBtn, width:'auto', padding:'10px 24px', marginTop:16}} onClick={() => { setCurrent(0); loadProfiles(); }}>
            Refresh
          </button>
        </div>
      )}
    </div>
  );
}
